#include <iostream>
#include <unordered_map>
#include <unordered_set>
#include <string>
#include <vector>

using namespace std;

class Solution {
public:
    int maxProduct(vector<string>& words) {
        int sz = words.size();
        vector<int> v(sz, 0);
        vector<int> v2;

        int maxP = 0;

        for (int i = 0; i < sz; ++i)
        {
            int sz2 = words[i].size();
            v2.push_back(sz2);

            for (int j = 0; j < sz2; ++j)
            {
                v[i] = v[i] | (1 << (words[i][j] - 'a'));
            }
        }

        for (int i = 0; i < sz - 1; ++i)
        {
            for (int j = i + 1; j < sz; ++j)
            {
                // be careful about the bit and operation, not bit or operation.
                if (!(v[i] & v[j]))
                {
                    maxP = max(maxP, v2[i] * v2[j]);
                }
            }
        }

        return maxP;
    }

    int maxProduct1(vector<string>& words) {
        unordered_map<char, unordered_set<int>> m;
        int sz = words.size();
        vector<int> v;

        for (int i = 0; i < sz; ++i)
        {
            int sz2 = words[i].size();
            v.push_back(sz2);

            for (int j = 0; j < sz2; ++j)
            {
                char c = words[i][j];
                auto itr = m.find(c);

                if (itr == m.end())
                {
                    unordered_set<int> s;
                    s.insert(i);
                    m.emplace(c, s);
                }
                else
                {
                    // iterator is like a pointer, so use "->" instead of ".".
                    unordered_set<int> &s = itr->second;
                    s.insert(i);
                }
            }
        }

        int maxP = 0;

        for (int i = 0; i < sz; ++i)
        {
            vector<bool> v3(sz, true);

            for (int j = 0; j < v[i]; ++j)
            {
                for (auto a : m[words[i][j]])
                {
                    v3[a] = false;
                }
            }

            for (int k = 0; k < sz; ++k)
            {
                // be careful about the index v[i].
                // Don't forget maxP is v[i] * v[k];
                maxP = max(maxP, v[i] * (v3[k] ? v[k] : 0));
            }
        }

        return maxP;
    }
};

